import React from 'react'
import Graph from '../Graph/GraphVisualizer'
import LinkedList from '../LinkedList/LinkedListVisualizer'
import Tree from '../Tree/TreeVisualizer'

const Algorithm = (props) => {
    let selectedAlgo = null

    if (props.key === 'LinkedList') {
        selectedAlgo = <LinkedList/>
    } else if (props.key === 'Tree') {
        selectedAlgo = <Tree/>
    } else {
        selectedAlgo = <Graph/>
    }

    return(
        <div>
            {selectedAlgo}
        </div>
    )
}

export default Algorithm
